const categories = [
  {
    question:
      "Does everyone on my team have to meet the standards for the category we want to select?",
    answer:
      "No, the recommendation is that at least 2 athletes should meet the standards and the other 2 should have a level close to that of the standards. Try curating a team where everyone has complimentary strengths (e.g. one person can do HSPU, one is a good lifter, etc...).",
  },
  {
    question: "How are teams made up?",
    answer:
      "Teams are made up of 4 person mixed teams. Teams can be either MMMF, MMFF or MFFF. No changes to the team can be made on the day of the competition.",
  },
  {
    question: "three",
    answer: "three",
  },
  {
    question: "How do I log results?",
    answer:
      "You can log your team's results by logging into your account, going to your profile and you'll find a log results button",
  },
];

module.exports = { categories };
